import { Routes, Route } from "react-router-dom";
import Home from "./Components/Home/Home";
import LockR from "./Components/Lock-R/LockR";
import Mulhouse from "./Components/Lock-R/Mulhouse/Mulhouse";
import Strabourg from "./Components/Lock-R/Strasbourg/Strabourg";
import Navbar from "./Components/Navbar/Navbar";
import Profile from "./Components/Profile/Profile";
import Services from "./Components/Services/Services";

function App() {
  return (
    <div className="App">
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/services" element={<Services />} />
        <Route path="/profil/:id" element={<Profile />} />
        <Route path="/profil/*" element={<Profile />} />
        <Route path="/lock-r" element={<LockR />} />
        <Route path="/lock-r/mulhouse" element={<Mulhouse />}></Route>
        <Route path="/lock-r/strasbourg" element={<Strabourg />}></Route>
      </Routes>
    </div>
  );
}

export default App;
